Defendant Arturo Sanchez-Magana in court with attorney Michael Reyes.  
Sara Nicole Volden Schroeder appeared for the State of Wisconsin.  
Deputy Court Clerk: dds.  Deputy Court Clerk: dds.

Sworn as interpreter:  Dawn Maldonado.

Defendant prepared to enter change of plea.  Hearing proceeded.  Negotiations set forth by the state.

COUNT 1:  The defendant was advised of his constitutional rights and maximum penalties, waived all rights, plead GUILTY and was sworn and examined as to the plea.  Plea Questionnaire/Waiver of Rights, Addendum to Plea Questionnaire, and Jury Instructions received and filed.  The parties stipulate to the complaint as a factual basis for the plea.  The Court found the defendant guilty and ordered entry of Judgment of Conviction.  Pursuant to Wisconsin Statutes Section 973.176, the Court advised the defendant of the following restrictions:  Firearm possession and Voting.  

AS TO COUNT 2:  By operation of law the Court orders Count 2 DISMISSED.
AS TO COUNT 3:  Pursuant to plea negotiations and on state's motion, the Court orders Count 3 DISMISSED AND READ-IN  for the purpose of sentencing. 

Sentencing proceeded.  Statements made by State, defense, defendant, and Elizabeth A. 

The Court sentenced the defendant to a MAXIMUM TERM OF IMPRISONMENT of 4 YEARS with credit for 1 day. The INITIAL TERM OF CONFINEMENT in the Wisconsin State Prison System is 2 YEARS.  The MAXIMUM TERM OF EXTENDED SUPERVISION IS 2 YEARS.

The defendant IS NOT eligible for the Challenge Incarceration Program.  The defendant IS eligible for the Substance Abuse Program.  

The Court STAYED this sentence and placed the defendant on probation for a period of 30 MONTHS with the following conditions.

CONDITIONS OF PROBATION/EXTENDED SUPERVISION (if revoked):
*Serve 11 months in the House of Correction with release for employment- good time allowed;
*Obtain AODA assessment and complete follow-up care/treatment;
*No illegal drugs or alcohol with random urine screens;
*Participate in Parenting/Grandparenting counseling;
*Participate in Cognitive Thinking Intervention counseling;
*Pay all supervision fees;
*Provide DNA sample- pay surcharge;

The Court ordered defendant to pay a fine of $1800.00 plus all mandatory costs, penalties, surcharges, including $50.00 ignition interlock surcharge by the end of probation period- any remaining balance to convert to civil judgment.  Court ordered AODA assessment and Driver's Safety Plan; be in full compliance with plan conditions before license reinstated.  Court ordered defendant's driving privileges revoked for a period of 2 years.  Court ordered defendant restricted to operation of vehicles equipped with an ignition interlock device for 2 years.  If revoked, the Court ordered that all financial obligations be paid through collection by the Department of Corrections from 25% of funds under Sec. 973.05(4)(b) and as a condition of extended supervision.  Any remaining balance to convert to civil judgment. Appeal rights given.  Defendant remanded and taken into custody.

